// import "./css/Privacy.css"
import "./css/Accessibility.css"

function Accessibility() {


  // const button = document.querySelector('.accordion');

  // button.addEventListener("click", (event) => {
  //   if (!event.target.classList.contains('topic')) {
  //     return;
  //   }
  //   event.target.classList.toggle("topic--open");
  // });




  return (

    <div>

<div class="accordion">
            <h2>Recommended Products</h2>
            <button class="topic"  aria-label="click to expand the product introdution Scratching post">
                <span class="topic_title">Getting to the Duxford Battle of Britain Airshow.</span>
                <span class="topic_indicator"></span>
            </button>
            <div class="answer">
                A scratching post is a wooden post covered in rough material that cat owners provide so their pets have
                an acceptable place to scratch. Cats have a natural urge to scratch:[1] the action helps them remove old
                material from their claws, and they mark territory with scent glands in their paws. Indoor cats may be
                prevented from exercising this urge on furniture if they are provided with an acceptable scratching
                post.
            </div>

            <button class="topic" aria-label="click to expand the product introdution Cat bell">
                <span class="topic_title">Accommodation near Duxford</span>
                <span class="topic_indicator"></span>
            </button>
            <div class="answer">
                A cat bell is a bell attached to the collar of a cat to prevent the cat from harming local wildlife.
                The bell can warn potential prey of the cat's approach. Cats eventually learn to walk without ringing
                the bell and pet owners are therefore encouraged to regularly change the bell[1] or attach two bells on
                the collar.
            </div>
        </div>




      <div>
        <h2>
          Getting to the Duxford Battle of Britain Airshow.
        </h2>
        <p>

        </p>
        <div>
          <h3>By car</h3>
          <p>Duxford is in Cambridgeshire, off Junction 10 of the M11. If you are coming from the north, a signposted alternative is to leave at Junction 11 and take the A10 to Royston, then the A505. This is a much longer route bt it splits the traffic up.</p><p>The Post Code (for Sat Nav) is CB22 4QR but some systems will only recognise the older code CB2 4QR.</p>
          <p><span class="blue-button"><a href="https://www.google.com/maps/dir//IWM+Duxford,+Duxford,+Cambridge+CB22+4QR,+United+Kingdom/@51.6998,-1.472168,6z/data=!4m16!1m6!3m5!1s0x47d870963894862d:0x7c69bf53a1c0382d!2sIWM+Duxford!8m2!3d52.0960072!4d0.1354295!4m8!1m0!1m5!1m1!1s0x47d870963894862d:0x7c69bf53a1c0382d!2m2!1d0.1354295!2d52.0960072!3e3?hl=en-US" title="Click, then enter your postcode on next screen" target="_blank" rel="nofollow noopener"><i class="fa fa-car-side" title="Driving Directions"></i> &nbsp;Directions</a></span></p>
          <p>There are links to other route planners in the Travel Advice section.</p>
        </div>

        <div>
          <h3>By Train</h3>
          <p>The easiest (but not the closest) train station is Cambridge, which has a direct service from London. </p><p>Alternatives are Royston and Whittlesford Parkway, which is the closest to the show.</p>
          <p><a rel="nofollow noopener" href="http://ojp.nationalrail.co.uk/service/pockettimetable/search" target="_blank" title="create a pocket timetable for your journey">Click here to create a pocket timetable for your journey between any stations on the National Rail network. </a></p>


        </div>

      </div>
      <div>
      <h2>Accommodation near Duxford</h2>
    <p class="lead">It is best to book as far as possible in advance. This is not only because nearby hotels and guest houses tend get booked up well before the date of an airshow but also because prices can be better when you book early online.</p>
    <p>The location is already built in to the links but <strong>please check, and change as necessary, the dates, number of rooms and number of guests.</strong></p>

      </div>


<div>
<h2>Weather for the Duxford area</h2>

<div>
<h3>What the forecasts tell you</h3>
</div>
</div>

    </div>



    // <div class="columns">
    //   <div class="column">
    //     <h2>Your computer and cookies </h2>
    //     <p>We do not read anything from your computer.</p>
    //     <p>We do not write anything to your computer.</p>
    //     <p>We do not ourselves write or read 'cookies'. Cookies are little files that many web sites put on your computer, usually so that they can remember your settings next time you visit their site or to understand your interests. </p>
    //     <p>If you click on a link from our site to go to another web site, the owner of that other web site may have a different policy on cookies and privacy. They should publish their own policies on their web sites. </p>
    //     <p>We receive a statistical report (from the company we use to hold and send you the web pages) that tells us how many people visit BritishAirshows.com, how many times each page is read, and other general information about the use of the site. That report does not identify any visitor to the site. We are not able to identify any visitor to the site in any other way. </p>
    //   </div>

    //   {/* <div class="column">
    //     <h2>Information about you </h2>
    //     <p>We do not know, and therefore cannot keep, any information about you.</p>
    //     <p>You can contact us using the contact form without giving us your name or your email address. </p>
    //     <p>If you would like a response we will need your email address but will use it only to respond to you. </p>
    //   </div>

    //   <div class="column">
    //     <h2>Emails</h2>
    //     <p>If you send an email we will keep a copy of it and of our response for about 2 weeks or until any follow-up correspondence is finished.</p>
    //     <p>We will not keep a copy of your email address once the correspondence has been finished. </p>
    //     <p>We will not use your email address for any other reason than to respond to you. </p>
    //     <p>We will not pass your email address to any other person or organisation, or arrange for it to be put on any mailing list. </p>
    //     <h2>Mailing List</h2>
    //     <p>We do not keep a mailing list. We do not send newsletters, reminders, notifications or anything else to anyone, even to people who have given us their email address.</p>
    //   </div> */}
    // </div>



  );
}

export default Accessibility;
